import React from 'react';
import './styles.css';

const FormContainer = ({ documentData }) => {
  if (!documentData) {
    return <div className="column">Select a document to view details</div>;
  }

  // Example of rendering form fields based on documentData structure
  const renderFormFields = (fields) => {
    return fields.map((field, index) => (
      <div key={index}>
        <label>{field.input_label}</label>
        <input type={field.type} name={field.input_name} defaultValue={field.value} />
      </div>
    ));
  };

  return (
    <div className="column">
      <h2>{documentData.name}</h2>
      {/* Render form fields if they exist */}
      {documentData.fields && renderFormFields(documentData.fields)}
    </div>
  );
};

export default FormContainer;
